1. der  Eingetragene  ausdrücklich  auf  die  Ausübung  der  Tätigkeit  als  allgemein  beeideter  und 
gerichtlich zertifizierter Sachverständiger verzichtet; 
 2. die notwendige Rezertifizierung nicht erfolgt ist; 
 3. dem  allgemein  beeideten  und  gerichtlich  zertifizierten   Sachverständigen  diese  Eigenschaft 
entzogen wird; 
 4. der allgemein beeidete und gerichtlich zertifizierte Sachverständige verstorben ist.

4. dass jegliche Anführung von Sprachkenntnissen, welche von der Zertifizierung des Dolmetschers 
nicht umfasst sind, jedenfalls verbotene Inhalte im Sinne des § 3a Abs. 7 darstellen, gleiches gilt 
für das Anbot zur (entgeltlichen) Vermittlung von Gerichtsaufträgen; 
 5. dass  die  allgemein  beeideten  und  gerichtlich  zertifizierten  Dolmetscher  nach  Sprachen  geordnet 
in die Gerichtssachverständigen- und Gerichtsdolmetscherliste einzutragen sind;

1. sich  der  zuständige  Präsident  auf  geeignete  Weise  vom  Vorliegen  der  Sachkunde  und  der 
Kenntnisse über die wichtigsten Vorschriften des Sachverständigenwesens, die Befundaufnahme 
und  Gutachtenserstattung  sowie  vom  Vorliegen  der  anderen  Eintragungsvoraussetzungen  zu 
überzeugen hat; 
 2. der  Sachverständige  seinen  gewöhnlichen  Aufenthalt  oder  Ort  der  beruflichen  Tätigkeit  im 
Sprengel des Bezirksgerichts hat, in dessen Liste er die Eintragung beantragt;

2. der  Sachverständige  seinen  gewöhnlichen  Aufenthalt  oder  Ort  der  beruflichen  Tätigkeit  im 
Sprengel des Bezirksgerichts hat, in dessen Liste er die Eintragung beantragt; 
 3. die  Eintragung  nur  mit  Wirkung  für  ein  einziges  Bezirksgericht  und  nur  auf  Grund  eines 
schriftlichen Antrags des Bewerbers vorgenommen werden darf; 
 4. der    zuständige    Präsident    dem    Sachverständigen    anlässlich    seiner    Eintragung    eine

schriftlichen Antrags des Bewerbers vorgenommen werden darf; 
 4. der    zuständige    Präsident    dem    Sachverständigen    anlässlich    seiner    Eintragung    eine 
Legitimationsurkunde  ausstellt;  diese  hat  der  Sachverständige  bei  seiner  Tätigkeit  mit  sich  zu 
führen und auf Verlangen vorzuweisen; 
 5. der Sachverständige bei der Unterfertigung schriftlicher Gutachten kein Siegel zu verwenden hat; 
unter der Unterschrift hat er seinen Namen und seine Eigenschaft zu bezeichnen;

5. der Sachverständige bei der Unterfertigung schriftlicher Gutachten kein Siegel zu verwenden hat; 
unter der Unterschrift hat er seinen Namen und seine Eigenschaft zu bezeichnen; 
 6. die Listen der allgemein beeideten gerichtlichen Sachverständigen der einzelnen Bezirksgerichte 
nicht  allgemein  zugänglich  zu  veröffentlichen  sind;  diese  Listen  sind  den  jeweils  betroffenen 
Bezirksgerichten   für   deren   Wirkungsbereich   bis   zum   31. Dezember   eines   jeden   Jahres 
mitzuteilen.
